import React from 'react';
import ReactTable from "react-table";
import 'react-table/react-table.css'
//import Post from './Post'

class PostTable extends React.Component{
  constructor(props)
  {
  	super(props);
  }	

  render() {
  	const columns =[
         {
             Header: "Name",
             accessor: "name",
             style: {
                 textAlign: "right"
             },
             width: 100,
             maxwidth: 100,
             minwidth: 100
         },
         {
            Header: "Title",
            accessor: "title",
            sortable: false,
            filterable: false
        },
        {
            Header: "Author",
            accessor: "author",
            sortable: false,
            filterable: false
        },
        {
            Header: "Description",
            accessor: "description",
            sortable: false,
            filterable: false
        },
        {
            Header: "Category",
            accessor: "category",
            sortable: false,
            filterable: false
        },
        {
            Header: "Published at",
            accessor: "published_at",
            sortable: false,
            filterable: false
        },
        {
            Header: "Last edited at",
            accessor: "last_edited_at",
            sortable: false,
            filterable: false
        },
        {
            Header: "Action",
            Cell: props => {
                return (
                    <button className=""
                    onClick={() => {
                        console.log("cliocked");
                        this.deleteRecord(props.original.id);
                    }}
                    >
                    Delete
                    </button>
                )
            },
            sortable: false,
            filterable: false,
            width: 100,
            maxwidth: 100,
            minwidth: 100
        }

     ]

     return(
      <div>
         <ReactTable 
          columns={columns}
          data={this.props.posts}
          pageSize={this.props.posts.length}
          showPagination={false}
          >
          </ReactTable>


      </div>
    )

  }

}


export default PostTable;
